//Base URL

const urlDroplet = "https://proxey.xyz/tomcat/exam";
const urlLocal = "http://localhost:8080/exam";
export const myUrl = urlLocal;

export const getAllAssistants = `${myUrl}/api/cw/allAssistants`
export const bookingUrl = `${myUrl}/api/cw/book`
export const addAssistantToBooking = `${myUrl}/api/cw/booking`

export const addCar = `${myUrl}/api/cw/addcar`

export const createUrl = `${myUrl}/api/cw/newassistant`
export const deleteUrl = `${myUrl}/api/cw/removeassistant`


export const login = `${myUrl}/api/login`;
export const signup = `${myUrl}/api/login/create`;
